free=fetch('node.memory.bytes')$global_tag_filter.tag_filter("state==free").downsample('[[__interval]]','avg');
total=fetch('node.memory.total.bytes')$global_tag_filter.downsample('[[__interval]]', 'avg');
free_perc = free.div(total, on="host");
usage = 1;
usage= usage.sub(free_perc);
output(usage);

idle_cpu=fetch('node.cpu.ticks.count', rate='true').tag_filter('type==idle').downsample('[[__interval]]', 'avg');
count=idle_cpu.count();
idle_cpu_percent=idle_cpu.sum().div(count);
hundred=100;
used_cpu_percent=hundred.sub(idle_cpu_percent);
top3 = hundred.sub(idle_cpu).top3();
output(top3, used_cpu_percent);

memtotal=fetch('node.memory.total.bytes').downsample('[[__interval]]', 'avg');
memfree=fetch('node.memory.bytes').tag_filter('state==free').downsample('[[__interval]]', 'avg');
membuffers=fetch('node.memory.bytes').tag_filter('state==buffers').downsample('[[__interval]]', 'avg');
memcached=fetch('node.memory.bytes').tag_filter('state==cached').downsample('[[__interval]]', 'avg');
memunused=memfree.add(membuffers, ignore='state').add(memcached, ignore='state');
hundred=100;
mem_available_percent=memunused.div(memtotal).mult(hundred);
avg_mem_available_percent=memunused.sum().div(memtotal.sum()).mult(hundred);
mem_used_percent=hundred.sub(mem_available_percent);
avg_mem_used_percent=hundred.sub(avg_mem_available_percent);
top3=mem_used_percent.top3();
output(avg_mem_used_percent, top3);

